const NumberList = ({ pageQuantity }) => {
  const array = [];
  // console.log(pageQuantity);
  for (let i = 1; i === pageQuantity; i++) {
    array.push(i);
  }
  console.log(pageQuantity);

  return (
    <ul>
      {array.map((num) => {
        return <li>{num}</li>;
      })}
    </ul>
  );
};
export default NumberList;
